Pat Benatar - Invincible [promo].VOB


Very HQ rare theme from &quot;The Legend Of Billie Jean&quot; movie soundtrack promo music video. &quot;Invincible&quot; is a song from Seven the Hard Way, Pat Benatar's seventh album, released in 1985. &quot;Seven albums in seven years...Two dice...3 and a half dots each. Seven...the hard way.&quot; It peaked at #26 on the U.S. Billboard 200 and produced two hits: &quot;Invincible&quot; and &quot;Sex as a Weapon&quot;.

Pat commented at her concerts before performing &quot;Invincible&quot;: &quot;This is from one of the worst movies ever made.&quot; This statement refers to the film The Legend of Billie Jean, which did poorly at the box office, and became a cult classic to MTV fans in general.

The album failed to certify platinum.

Scott St. Clair Sheets returns to the fold since 1981's Precious Time and Frank Linx replaces Donny Vossov on Bass.

Pat Benatar (born Patricia Mae Andrzejewski January 10, 1953) is an American singer and four time Grammy winner. She had considerable commercial success particularly in the United States. During the 1980s, Benatar had two RIAA-certified Multi-Platinum albums, five RIAA-certified Platinum albums, three RIAA-certified Gold albums and 19 Top 40 singles, including &quot;Love Is a Battlefield&quot;, &quot;Hit Me with Your Best Shot&quot;, &quot;We Belong&quot; and &quot;Heartbreaker&quot;. Benatar was one of the most heavily played artists in the early days of MTV.
